import React, { useEffect, useState } from "react";
import { connect, useDispatch, useSelector } from "react-redux";
import { Link, useNavigate } from "react-router-dom";
import withRouter from "../../components/withRouter";

import { useFormik } from "formik";
import * as Yup from "yup";
import {
  Container,
  Row,
  Col,
  Card,
  CardBody,
  FormGroup,
  Form,
  Input,
  Button,
  Label,
  InputGroup,
} from "reactstrap";

//Import action
import { registerUser, apiError } from "../../redux/actions";

//i18n
import { useTranslation } from "react-i18next";

//Import Images
import logodark from "../../assets/images/logo-dark.png";
import logolight from "../../assets/images/logo-light.png";


import { registerProfileRequest } from "../../redux/profile/actions";

/**
 * Register component
 * @param {*} props
 */
const Register = () => {
  const [userName, setUserName] = useState("username");
  const [email, setEmail] = useState("email@gmail.com");
  const [passwordHash, setPasswordHash] = useState("password");
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const { t } = useTranslation();

  document.title = "Register | Chatvia React - Responsive Bootstrap 5 Chat App";
    const handleSubmit = (e)=> {
        e.preventDefault();
        // dispatch(registerUser(userName, passwordHash, email, navigate));
        dispatch(registerProfileRequest(userName, passwordHash, email));

    }



  return (
    <React.Fragment>
      <div className="account-pages my-5 pt-sm-5">
        <Container>
          <Row className="justify-content-center">
            <Col md={8} lg={6} xl={5}>
              <div className="text-center mb-4">
                <Link to="/" className="auth-logo mb-5 d-block">
                  <img
                    src={logodark}
                    alt=""
                    height="30"
                    className="logo logo-dark"
                  />
                  <img
                    src={logolight}
                    alt=""
                    height="30"
                    className="logo logo-light"
                  />
                </Link>

                <h4>{t("Register")}</h4>
                <p className="text-muted mb-4">
                  {t("Get your Chatvia account now")}.
                </p>
              </div>

              <Card>
                <CardBody className="p-4">
                  <Form onSubmit={handleSubmit}>
                    <div className="mb-3">
                      <Label className="form-label">{t("Email")}</Label>
                      <InputGroup className="input-group bg-soft-light rounded-3 mb-3">
                        <span className="input-group-text text-muted">
                          <i className="ri-mail-line"></i>
                        </span>
                        <Input
                          type="text"
                          id="email"
                          name="email"
                          className="form-control form-control-lg bg-soft-light border-light"
                          placeholder="Enter Email"
                          onChange={(e)=> setEmail(e.target.value)}
                          value={email}
                        />
                      </InputGroup>
                    </div>

                    <div className="mb-3">
                      <Label className="form-label">{t("Username")}</Label>
                      <InputGroup className="mb-3 bg-soft-light input-group-lg rounded-lg">
                        <span className="input-group-text border-light text-muted">
                          <i className="ri-user-2-line"></i>
                        </span>
                        <Input
                          type="text"
                          id="username"
                          name="username"
                          className="form-control form-control-lg bg-soft-light border-light"
                          placeholder="Enter Username"
                          onChange={(e) => setUserName(e.target.value)}
                          value={userName}
                        />
                      </InputGroup>
                    </div>

                    <FormGroup className="mb-4">
                      <Label className="form-label">{t("Password")}</Label>
                      <InputGroup className="mb-3 bg-soft-light input-group-lg rounded-lg">
                        <span className="input-group-text border-light text-muted">
                          <i className="ri-lock-2-line"></i>
                        </span>
                        <Input
                          type="password"
                          id="password"
                          name="password"
                          className="form-control form-control-lg bg-soft-light border-light"
                          placeholder="Enter Password"
                          onChange={(e)=> setPasswordHash(e.target.value)}
                          value={passwordHash}
                        />
                      </InputGroup>
                    </FormGroup>

                    <div className="d-grid">
                      <Button
                        color="primary"
                        block
                        className=" waves-effect waves-light"
                        type="submit"
                      >
                        Register
                      </Button>
                    </div>

                    <div className="mt-4 text-center">
                      <p className="text-muted mb-0">
                        {t("By registering you agree to the Chatvia")}{" "}
                        <Link to="#" className="text-primary">
                          {t("Terms of Use")}
                        </Link>
                      </p>
                    </div>
                  </Form>
                </CardBody>
              </Card>

              <div className="mt-5 text-center">
                <p>
                  {t("Already have an account")} ?{" "}
                  <Link to="login" className="font-weight-medium text-primary">
                    {" "}
                    {t("Signin")}{" "}
                  </Link>{" "}
                </p>
                <p>
                  © {new Date().getFullYear()} {t("Chatvia")}.{" "}
                  {t("Crafted with")}{" "}
                  <i className="mdi mdi-heart text-danger"></i>{" "}
                  {t("by Themesbrand")}
                </p>
              </div>
            </Col>
          </Row>
        </Container>
      </div>
    </React.Fragment>
  );
};

export default Register
